/**
* HYExtStream
* @namespace HYExtStream
*/
import {
    NativeModules,
} from 'react-native';

const NativeExtStream = NativeModules.HYExtStream;

class ExtStream {
    
    
    addExtraWhiteBoard(data){
        return NativeExtStream.addExtraWhiteBoard(data);
    }

    removeExtraWhiteBoard(data){
        return NativeExtStream.removeExtraWhiteBoard(data);
    }

    sendToExtraWhiteBoard(data){
        return NativeExtStream.sendToExtraWhiteBoard(data);
    }
}

const HYExtStream = new ExtStream();

export default HYExtStream;
